import { VideoList } from "./components/VideoList";


function App() {
	function getDigitsSum(num){
    const arr = num.String().split();
    let sum = 0;
    arr.arr.forEach(element => {
      sum += Number(element);
    });
  }
  return getDigitsSum(123);
}

export default App;
